function llenarEvento(a){for(var t={LUNES:0,MARTES:1,MIERCOLES:2,JUEVES:3,VIERNES:4},n={7:0,8:1,9:2,10:3,11:4,12:5,13:6,14:7,15:8,16:9,17:10,18:11,19:12},r=0;r<a.length;r++){var o=a[r],d=o.materia,e=o.profesor,i=o.dia,E=o.salon,l=o.hora,s=o.duracion,v=1+r,S=d+"</br>"+e,f='<li class="tt-event btn-info" data-id="'+v+'" data-day="'+t[i]+'" data-start="'+n[l]+'" data-duration="'+s+'">'+S+"</li>",c="#salon"+E+" .tt-events";$(c).append(f)}}